Circuit.create!(name: 'Autódromo Salto',             location: 'Salto, Salto',           description: 'Es un circuito rápido y la zona de mayor tensión es el primer curvón, que posee un gran peralte al mejor estilo de óvalo de una pista estadounidense. Por la velocidad a la que se llega (casi 250 km/h), la segunda curva se ha transformado en otro sector clave. El resto se hace continuamente doblando, por lo que la puesta de las suspensiones es muy importante. El chasis debe patinar poco y deslizarse lo suficiente para que el motor no se caiga en potencia. El autódromo de la ciudad de Paraná posee unas instalaciones perfectas en boxes. El 5 de octubre de 2003 se corrió aquí la Carrera número 1000 del Turismo Carretera. Paraná se encuentra en la provincia de Entre Ríos a 499 km de la ciudad de Buenos Aires, a 370 km de Córdoba y a 175 km de Rosario. Y para llegar al circuito desde el centro hay que tomar por la Avenida Circunvalación hasta el acceso Norte. Allí debe seguir los carteles hacia la Ruta 12 desde el cruce del acceso norte y la Ruta 12, el autódromo se encuentra a unos 2 km hacia la izquierda.', large: '1352', map_position: 'https://www.google.com/maps/embed?pb=!1m14!1m12!1m3!1d2183.515155187242!2d-57.958756450091066!3d-31.41540495028035!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!5e1!3m2!1ses!2suy!4v1437689640178', video_url: 'BmEkRGJzu_c')
